in_source: |-
  int32 divide_by_10(int32 number) {
  	int32 result = 0;
  	while (number > 9) {
  		number = number - 10;
  		result = result + 1;
  	}
  	number = result;
  }
  
  void print_int(int32 j) {
  	int8 buffer[10]
  	int32 i=0;
  	
  	do {
  		buffer[i] = j%10+48
  		i = i + 1
  		j = divide_by_10(j)
  	} while (j!=0)
  	
  	while (i>0) {
  		i = i - 1
  		OUT(buffer[i])
  	}
  }
  
  void prob2(int32 n) {
  	int32 a1 = 1
  	int32 a2 = 2
  	int32 sum = 0
  	while(a2<n){
  		if (a2%2==0){sum=sum+a2}
  		int32 a3 = a1+a2
  		a1 = a2
  		a2 = a3
  	}
  	print_int(sum)
  }
  
  prob2(100)
  
